      module Airports

      use precis_param

      use io_units

      use io_data,       only : &
         Ash3dHome

      !use Output_Vars,    only : &
      !   DepArrivalTime_FillValue,CloudArrivalTime_FillValue

      integer, parameter             :: MAXAIRPORTS     = 10000

      integer                        :: NAIRPORTS_EWERT     ! number of airports in the global list in Read_GlobalAirports
      integer                        :: nairports           ! number of nearby airports in domain
      integer                        :: n_ext_airports      ! number of nearby airports in external file
      integer                        :: n_airports_total    ! number of airports in external file

      logical                        :: ProjectAirportLocations
      integer,           allocatable :: Airport_i(:)
      integer,           allocatable :: Airport_j(:)
         
      real(kind=ip),     allocatable :: AirportFullLat(:)
      real(kind=ip),     allocatable :: AirportFullLon(:)
      character(len=3),  allocatable :: AirportFullCode(:)
      character(len=42), allocatable :: AirportFullName(:)

      real(kind=ip)                  :: ExtAirportLat(MAXAIRPORTS)
      real(kind=ip)                  :: ExtAirportLon(MAXAIRPORTS)
      character(len=3)               :: ExtAirportCode(MAXAIRPORTS)
      character(len=38)              :: ExtAirportName(MAXAIRPORTS)

      real(kind=ip),     allocatable :: Airport_x(:)
      real(kind=ip),     allocatable :: Airport_y(:)
      real(kind=ip),     allocatable :: Airport_AshArrivalTime(:)   !ash arrival time
      real(kind=ip),     allocatable :: Airport_AshDuration(:)      !duration of ashfall
      real(kind=ip),     allocatable :: Airport_CloudArrivalTime(:) !cloud arrival time
      real(kind=ip),     allocatable :: Airport_CloudDuration(:)    !duration of cloud overhead
      real(kind=ip),     allocatable :: Airport_DepRate(:)          !deposit thickness change during this time step
      real(kind=ip),     allocatable :: Airport_DepRateLast(:)      !deposit thickness change during last time step
      real(kind=ip),     allocatable :: Airport_Thickness(:)        !deposit thickness this time step
      real(kind=ip),     allocatable :: Airport_ThicknessLast(:)    !deposit thickness last time step
      real(kind=ip),     allocatable :: Airport_Latitude(:)
      real(kind=ip),     allocatable :: Airport_Longitude(:)  
      real(kind=ip),     allocatable :: Airport_CloudHere(:)        !cloud load overhead
      real(kind=ip),     allocatable :: Airport_CloudHereLast(:)    !cloud load overhead in last time step

      real(kind=ip),     allocatable :: Airport_Thickness_TS(:,:)   !deposit thickness for all output times
      integer,           allocatable :: Airport_TS_plotindex(:)

      character(len=130)             :: AirportMasterFile           !Only needed if USEEXTDATA=T
      character(len=130)             :: AirportInFile
      character(len=35), allocatable :: Airport_Name(:)
      character(len=3),  allocatable :: Airport_Code(:)
      logical, allocatable           :: Airport_AshArrived(:)
      logical, allocatable           :: Airport_CloudArrived(:)       

      integer, allocatable           :: inext(:)    ! i node just east of airport
      integer, allocatable           :: jnext(:)    ! j node just north of airport

      contains

!##############################################################################

      subroutine Allocate_Airports(nair,nWT)

      implicit none

      integer :: nair
      integer :: nWT

!     ALLOCATE ARRAY OF AIRPORTS TO BE USED IN THE MAIN PROGRAM
      allocate(Airport_Name(nair))             ;             Airport_Name = ' '
      allocate(Airport_Code(nair))             ;             Airport_Code = ' '
      allocate(Airport_x(nair))                ;                Airport_x = 0.0_ip
      allocate(Airport_y(nair))                ;                Airport_y = 0.0_ip
      allocate(Airport_i(nair))                ;                Airport_i = 0
      allocate(Airport_j(nair))                ;                Airport_j = 0
      allocate(Airport_Latitude(nair))         ;         Airport_Latitude = 0.0_ip
      allocate(Airport_Longitude(nair))        ;        Airport_Longitude = 0.0_ip
      allocate(inext(nair))                    ;                    inext = 0
      allocate(jnext(nair))                    ;                    jnext = 0
      allocate(Airport_AshArrived(nair))       ;       Airport_AshArrived = .false.
      allocate(Airport_CloudArrived(nair))     ;     Airport_CloudArrived = .false.
      allocate(Airport_AshArrivalTime(nair))   ;   Airport_AshArrivalTime = -9999.0_ip
      allocate(Airport_CloudArrivalTime(nair)) ; Airport_CloudArrivalTime = -9999.0_ip
      !allocate(Airport_AshArrivalTime(nair))   ;   Airport_AshArrivalTime = DepArrivalTime_FillValue
      !allocate(Airport_CloudArrivalTime(nair)) ; Airport_CloudArrivalTime = CloudArrivalTime_FillValue
      allocate(Airport_AshDuration(nair))      ;      Airport_AshDuration = 0.0_ip
      allocate(Airport_CloudDuration(nair))    ;    Airport_CloudDuration = 0.0_ip
      allocate(Airport_CloudHere(nair))        ;    Airport_CloudHere     = 0.0_ip       !cloud load overhead
      allocate(Airport_CloudHereLast(nair))    ;    Airport_CloudHereLast = 0.0_ip       !cloud load overhead in last time step
      allocate(Airport_DepRate(nair))          ;          Airport_DepRate = 0.0_ip
      allocate(Airport_DepRateLast(nair))      ;      Airport_DepRateLast = 0.0_ip
      allocate(Airport_Thickness(nair))        ;        Airport_Thickness = 0.0_ip
      allocate(Airport_ThicknessLast(nair))    ;    Airport_ThicknessLast = 0.0_ip
      allocate(Airport_Thickness_TS(nair,nWT)) ;     Airport_Thickness_TS = 0.0_ip
      allocate(Airport_TS_plotindex(nair))     ;     Airport_TS_plotindex = 0

      end subroutine Allocate_Airports

!##############################################################################

!##############################################################################

      subroutine Deallocate_Airports

      implicit none

!     ALLOCATE ARRAY OF AIRPORTS TO BE USED IN THE MAIN PROGRAM
      if(allocated(Airport_Name))              deallocate(Airport_Name)
      if(allocated(Airport_Code))              deallocate(Airport_Code)
      if(allocated(Airport_x))                 deallocate(Airport_x)
      if(allocated(Airport_y))                 deallocate(Airport_y)
      if(allocated(Airport_i))                 deallocate(Airport_i)
      if(allocated(Airport_j))                 deallocate(Airport_j)
      if(allocated(Airport_Latitude))          deallocate(Airport_Latitude)
      if(allocated(Airport_Longitude))         deallocate(Airport_Longitude)
      if(allocated(inext))                     deallocate(inext)
      if(allocated(jnext))                     deallocate(jnext)
      if(allocated(Airport_AshArrived))        deallocate(Airport_AshArrived)
      if(allocated(Airport_CloudArrived))      deallocate(Airport_CloudArrived)
      if(allocated(Airport_AshArrivalTime))    deallocate(Airport_AshArrivalTime)
      if(allocated(Airport_CloudArrivalTime))  deallocate(Airport_CloudArrivalTime)
      if(allocated(Airport_AshDuration))       deallocate(Airport_AshDuration)
      if(allocated(Airport_CloudDuration))     deallocate(Airport_CloudDuration)
      if(allocated(Airport_CloudHere))         deallocate(Airport_CloudHere)
      if(allocated(Airport_CloudHereLast))     deallocate(Airport_CloudHereLast)
      if(allocated(Airport_DepRate))           deallocate(Airport_DepRate)
      if(allocated(Airport_DepRateLast))       deallocate(Airport_DepRateLast)
      if(allocated(Airport_Thickness))         deallocate(Airport_Thickness)
      if(allocated(Airport_ThicknessLast))     deallocate(Airport_ThicknessLast)
      if(allocated(Airport_Thickness_TS))      deallocate(Airport_Thickness_TS)
      if(allocated(Airport_TS_plotindex))      deallocate(Airport_TS_plotindex)

      end subroutine Deallocate_Airports

!##############################################################################

      subroutine ReadAirports

!     Subroutine that finds the time of first arrival of tephra at specified
!     locations within the modeled area.

      use mesh,          only : &
         IsLatLon,A3d_iprojflag,A3d_lam0,A3d_phi0,A3d_phi1,A3d_phi2,A3d_k0_scale,&
         A3d_radius_earth,de,dn,dx,dy,xLL,yLL,xUR,yUR,latLL,lonLL,latUR,lonUR

      use io_data,       only : &
         AppendExtAirportFile,nWriteTimes,ReadExtAirportFile

      use projection,    only : &
         PJ_proj_for

      implicit none

      integer :: i,ind
      real(kind=ip)      :: xnow, ynow
      character(len=35)  :: NameNow
      character(len=3)   :: CodeNow
      real(kind=ip)      :: latitude, longitude
      real(kind=dp)      :: lat_in,lon_in,xout,yout

      call Read_GlobalAirports(NAIRPORTS_EWERT)

      !If we are reading an external airport file
      if (ReadExtAirportFile) then
        call ReadExtAirports
      endif
      if (ReadExtAirportFile.eqv..false.) then
        n_airports_total = NAIRPORTS_EWERT                     !if not reading external file
      elseif (AppendExtAirportFile.eqv..true.) then
        n_airports_total = NAIRPORTS_EWERT + n_ext_airports    !if appending external to internal
        if(n_airports_total.gt.MAXAIRPORTS)then
          write(global_error,*)"ERROR: ",&
           "Too many airports are requested."
          write(global_error,*)&
            "       Increase MAXAIRPORTS and recompile"
        endif 
        do i=NAIRPORTS_EWERT+1,n_airports_total
          AirportFullLat(i)  = ExtAirportLat(i-NAIRPORTS_EWERT)
          AirportFullLon(i)  = ExtAirportLon(i-NAIRPORTS_EWERT)
          AirportFullCode(i) = ExtAirportCode(i-NAIRPORTS_EWERT)
          AirportFullName(i) = ExtAirportName(i-NAIRPORTS_EWERT)
          !make sure longitude is between 0
          if (AirportFullLon(i).lt.0.0_ip) &
            AirportFullLon(i) = AirportFullLon(i)+360.0_ip
        enddo
        write(global_info,*) 'Appending airports below to the internal list.'
        write(global_info,*) 'Airport name       lon      lat'
        do i=NAIRPORTS_EWERT+1,n_airports_total
          write(global_info,*) AirportFullName(i),AirportFullLon(i),AirportFullLat(i)
!2563      format(a42,2f12.4)
        enddo
      else
        n_airports_total = n_ext_airports                      !if only reading external
        do i=1,n_airports_total
          AirportFullLat(i)  = ExtAirportLat(i)
          AirportFullLon(i)  = ExtAirportLon(i)
          AirportFullCode(i) = ExtAirportCode(i)
          AirportFullName(i) = ExtAirportName(i)
        enddo
        !write(global_info,*) 'Replacing internal airports with the points below'
        !write(global_info,*) 'Airport name       lon      lat'
        !do i=1,n_airports_total
        !  write(global_info,2563) AirportFullName(i),AirportFullLon(i),AirportFullLat(i)
        !enddo
      endif

      ! Loop through n_airports_total twice:
      !   first to determine how many airports are in the domain
      !   next to populate external variables

      nairports = 0
      do i = 1, n_airports_total
        !make sure longitude is between 0
        if (AirportFullLon(i).lt.0.0_ip) &
          AirportFullLon(i) = AirportFullLon(i)+360.0_ip
        latitude  = AirportFullLat(i)
        longitude = AirportFullLon(i)

        if (IsLatLon) then
          if ((longitude.ge.lonLL+de) .and. &
              (longitude.le.lonUR-de) .and. &
              (latitude.ge.latLL+dn)  .and. &
              (latitude.le.latUR-dn)) then
            nairports = nairports+1
          endif
        else
          ! convert lat/lon to the projected values.
          if (ProjectAirportLocations) then
            lon_in = longitude
            lat_in = latitude
            call PJ_proj_for(lon_in,lat_in, A3d_iprojflag, &
                       A3d_lam0,A3d_phi0,A3d_phi1,A3d_phi2,A3d_k0_scale,A3d_radius_earth, &
                       xout,yout)
            xnow = xout
            ynow = yout
          endif

          if ((xnow.ge.xLL+dx) .and. &
              (xnow.le.xUR-dx) .and. &
              (ynow.ge.yLL+dy) .and. &
              (ynow.le.yUR-dy)) then
            nairports = nairports+1
          endif
        endif
      enddo

      ! ALLOCATE ARRAY OF AIRPORTS TO BE USED IN THE MAIN PROGRAM
      call Allocate_Airports(nairports,nWriteTimes)

      ind = 0
      do i = 1, n_airports_total
        latitude  = AirportFullLat(i)
        longitude = AirportFullLon(i)
        CodeNow   = AirportFullCode(i)(1:3)
        NameNow   = AirportFullName(i)(1:35) ! Copy to a temp variable and
                                             ! truncate to 35 chars
        xnow = 0.0_ip
        ynow = 0.0_ip
        if (IsLatLon) then
          if ((longitude.ge.lonLL+de) .and. &
              (longitude.le.lonUR-de) .and. &
              (latitude.ge.latLL+dn)  .and. &
              (latitude.le.latUR-dn)) then
            ind = ind + 1
            Airport_Code(ind) = CodeNow
            Airport_Name(ind) = NameNow
            Airport_x(ind) = xnow
            Airport_y(ind) = ynow
            Airport_Latitude(ind) = latitude
            Airport_Longitude(ind) = longitude

            Airport_i(ind) = int((Airport_Longitude(ind)-lonLL)/de) +1
            Airport_j(ind) = int((Airport_Latitude(ind)-latLL)/dn) +1
            !find inext(i), jnext(i) for bilinear interpolation
            if ((Airport_Longitude(ind)-&
                 (lonLL+real(Airport_i(ind)-1,kind=ip)*de)).lt.(de/2.0_ip)) then
              inext(ind)=Airport_i(ind)
            else
              inext(ind)=Airport_i(ind)+1
            endif
            if ((Airport_Latitude(ind)-&
                 (latLL+real(Airport_j(ind)-1,kind=ip)*dn)).lt.(dn/2.0_ip)) then
              jnext(ind)=Airport_j(ind)
            else
              jnext(ind)=Airport_j(ind)+1
            endif
          endif
        else
          ! convert lat/lon to the projected values.
          if (ProjectAirportLocations) then
            lon_in = longitude
            lat_in = latitude
            call PJ_proj_for(lon_in,lat_in, A3d_iprojflag, &
                       A3d_lam0,A3d_phi0,A3d_phi1,A3d_phi2,A3d_k0_scale,A3d_radius_earth, &
                       xout,yout)
            xnow = xout
            ynow = yout
          endif

          ! HFS: This might be in error
          !      Do we want to assume all input coordinates from
          !      secondary files (Airport, 1D wind) be in lon/lat?
          ! If we're not using the proj4 library, read the x and y values from
          ! the file.
          ! They are assumed to be in the same projection system as the wind
          ! files.
          if ((xnow.ge.xLL+dx) .and. &
              (xnow.le.xUR-dx) .and. &
              (ynow.ge.yLL+dy) .and. &
              (ynow.le.yUR-dy)) then
            ind = ind + 1
            Airport_Name(ind) = NameNow
            Airport_x(ind) = xnow
            Airport_y(ind) = ynow
            Airport_Latitude(ind) = latitude
            Airport_Longitude(ind) = longitude
            Airport_i(ind) = int((Airport_x(ind)-xLL)/dx) +1
            Airport_j(ind) = int((Airport_y(ind)-yLL)/dy) +1
            !find inext(i), jnext(i) for bilinear interpolation
            if ((Airport_x(ind)-(xLL+real(Airport_i(ind)-1,kind=ip)*dx)).lt.(dx/2.0_ip)) then
              inext(ind)=Airport_i(ind)
            else
              inext(ind)=Airport_i(ind)+1
            endif
            if ((Airport_y(ind)-(yLL+real(Airport_j(ind)-1,kind=ip)*dy)).lt.(dy/2.0_ip)) then
              jnext(ind)=Airport_j(ind)
            else
              jnext(ind)=Airport_j(ind)+1
            endif
          endif
        endif
      enddo

!     WRITE OUT AIRPORT NAMES TO LOG FILE
      write(global_info,3) nairports
      write(global_log ,3) nairports

      deallocate(AirportFullLat)
      deallocate(AirportFullLon)
      deallocate(AirportFullCode)
      deallocate(AirportFullName)

      return       

      !FORMAT STATEMENTS
3     format(/,5x,'Number of airports in modeled area = ',i5,/)

      end subroutine ReadAirports


!******************************************************************************

      function bilinear_thickness(i,OutVar)

!     function that calculates deposit thickness at airports by bilinear
!     interpolation

      use mesh,          only : &
         IsLatLon,nxmax,nymax,dx,dy,de,dn,yLL,xLL,LatLL,LonLL

      implicit none

      integer       :: i
      real(kind=ip) :: OutVar(nxmax,nymax)

      real(kind=ip) :: bilinear_thickness
      real(kind=ip) :: xnow, ynow, AREA, A11, A12, A21, A22, x1, x2, y1, y2
      real(kind=ip) :: z11, z12, z21, z22, znow

      if (IsLatLon) then
        xnow = Airport_Longitude(i)
        ynow = Airport_Latitude(i)
        x1   = lonLL+real(inext(i)-1,kind=ip)*de - 0.5_ip*de
        x2   = x1+de
        y1   = latLL+real(jnext(i)-1,kind=ip)*dn - 0.5_ip*dn
        y2   = y1+dn
      else
        xnow = Airport_x(i)
        ynow = Airport_y(i)
        x1   = xLL+real(inext(i)-1,kind=ip)*dx - 0.5_ip*dx
        x2   = x1+dx
        y1   = yLL+real(jnext(i)-1,kind=ip)*dy - 0.5_ip*dy
        y2   = y1+dy
      endif

      !First, see if the airport is on the corner or edge of the model domain
      if (((inext(i).eq.1).or.(inext(i).eq.(nxmax+1))).and. &
          ((jnext(i).eq.1).or.(jnext(i).eq.(nymax+1)))) then
        ! We're at a corner.  Don't interpolate
        znow = OutVar(Airport_i(i),Airport_j(i))
      elseif ((inext(i).eq.1).or.(inext(i).eq.nxmax+1)) then
        ! We're on the left or right edge.  Do a linear interpolation in y
        z11 = OutVar(Airport_i(i),jnext(i)-1)
        z22 = OutVar(Airport_i(i),jnext(i))
        znow =  z11 + (z22-z11)*(ynow-y1)/(y2-y1)        !do a linear interpolation in y
      elseif ((jnext(i).eq.1).or.(jnext(i).eq.nymax+1)) then
        ! We're on the top or bottom edge.  Do a linear interpolation in x
        z11 = OutVar(inext(i)-1,Airport_j(i))
        z22 = OutVar(inext(i)  ,Airport_j(i))
        znow =  z11 + (z22-z11)*(xnow-x1)/(x2-x1)
      else
        !the bilinear interpolation is the sum of the values in the four corners
        !that surround the point in question, weighted by the areas of the rectangles
        !to the upper left, upper right, lower left, and lower right of the point in
        !question, divided by the area of the entire square in which the point sits.
        A11  = (xnow-  x1) * (ynow -   y1)    !area of lower  left rectangle
        A21  = (x2  -xnow) * (ynow -   y1)    !area of lower right rectangle
        A12  = (xnow-  x1) * (y2   - ynow)    !area of upper  left rectangle
        A22  = (x2  -xnow) * (y2   - ynow)    !area of upper right rectangle
        AREA = (y2  -  y1) * (x2   -   x1)    !total area of node

        !thickness values at corners of the rectangle
        z11 = OutVar(inext(i)-1,jnext(i)-1)
        z21 = OutVar(inext(i)  ,jnext(i)-1)
        z12 = OutVar(inext(i)-1,jnext(i)  )
        z22 = OutVar(inext(i)  ,jnext(i)  )

        !thickness at the airport
        znow = (1.0_ip/AREA) * &  !reciprocal of area of large rectangle
           (z22 * A11    + &  !z22 times area in lower left
            z12 * A21    + &  !z12 times area in lower right
            z21 * A12    + &  !z21 times area in upper left
            z11 * A22)        !z11 times area in upper right
      endif

      bilinear_thickness = znow

      return

      end function bilinear_thickness

!******************************************************************************

      subroutine ReadExtAirports

      implicit none

      integer           :: inow,iostatus
      character(len=80) :: inputline

      inow = 0

!     OPEN THE AIRPORT LOCATION FILE
      open(unit=17,file=AirportInFile,status='old')
      read(17,'(a80)',iostat=Iostatus) inputline

!      READ AIRPORT LOCATIONS AND ASSIGN AIRPORTS IN THE MODELED AREA TO A
!      TEMPORARY ARRAY      
      do while (Iostatus.ge.0)
        inow = inow+1
        read(17,'(a80)',IOSTAT=Iostatus) inputline
        read(inputline,*,err=2010) ExtAirportLat(inow), ExtAirportLon(inow)
        read(inputline,2) ExtAirportCode(inow), ExtAirportName(inow)
2       format(50x,a3,1x,a35)
        !make sure longitude is between 0
        if (ExtAirportLon(inow).lt.0.0_ip) &
          ExtAirportLon(inow) = ExtAirportLon(inow)+360.0_ip
      enddo
      close(17)

      n_ext_airports = inow     !number of external airports read
      return

!     ERROR TRAP
2010  write(global_info,6) inputline
      write(global_log ,6) inputline
6     format('Error reading from airport list.  Read statement was expecting',/, &
             'latitude longitude x y  (all real numbers).  The input line gave:',/, &
             a80,/,'program stopped')

      end subroutine ReadExtAirports

!******************************************************************************

#ifdef USEEXTDATA
      subroutine Read_GlobalAirports(num_GlobAirports)

      use global_param,  only : &
        DirDelim

      implicit none

      integer, intent(out) :: num_GlobAirports

      integer                 :: i
      integer                 :: Iostatus    = 1
      real(kind=ip)           :: inx, iny
      real(kind=ip)           :: inlat, inlon
      character(len=120)      :: inputline
      character(len=35)       :: inName
      character(len=3)        :: inCode
      logical                 :: IsThere

      allocate(AirportFullLat(MAXAIRPORTS))
      allocate(AirportFullLon(MAXAIRPORTS))
      allocate(AirportFullCode(MAXAIRPORTS))
      allocate(AirportFullName(MAXAIRPORTS))

      AirportMasterFile = trim(Ash3dHome) // &
                          DirDelim // 'share' // &
                          DirDelim // 'GlobalAirports_ewert.txt'
      ! Test for existance of the airport file
      inquire( file=trim(adjustl(AirportMasterFile)), exist=IsThere )
      write(global_info,*)&
        "Trying to read external global airport file in home=",Ash3dHome
      write(global_info,*)"Full file name = ",trim(adjustl(AirportMasterFile))
      write(global_info,*)"  Exists = ",IsThere
      if(.not.IsThere)then
        write(global_error,*)"ERROR: Could not find airport file."
        write(global_error,*)"       Please copy file to this location:"
        write(global_error,*)AirportMasterFile
        stop 1
      endif

!     OPEN THE AIRPORT LOCATION FILE
      open(unit=17,file=AirportMasterFile,status='old',err=2000)
      ! Read first header line
      read(17,'(a120)',IOSTAT=Iostatus) inputline
!      READ AIRPORT LOCATIONS AND ASSIGN AIPORTS IN THE MODELED AREA TO A TEMPORARY ARRAY      
      i = 0
      do while (Iostatus.ge.0)
        read(17,'(a120)',IOSTAT=Iostatus) inputline
        read(inputline,*) inlat, inlon, inx, iny
        read(inputline,2) inCode,inName
        i = i+1
        if(i.gt.MAXAIRPORTS)then
          write(global_error,*)"ERROR: ",&
           "Airport file contains too many entries"
          stop 1
        endif
        AirportFullCode(i) = trim(adjustl(inCode))
        AirportFullName(i) = trim(adjustl(inName))
        AirportFullLat(i)  = inlat
        AirportFullLon(i)  = inlon
      end do

      ! return the number of airports in this global list.
      num_GlobAirports = i

      return

      !FORMAT STATEMENTS
2     format(50x,a3,2x,a35)
5     format(5x,'Error.  Can''t find input file ',a130,/,5x,'Program stopped')   
2000  write(6,5) AirportInFile

      end subroutine Read_GlobalAirports
!******************************************************************************

#else
      ! This branch is compiled if the list should be built in
      subroutine Read_GlobalAirports(num_GlobAirports) !(NAIRPORTS,AirportFullLat,AirportFullLon, nAirportFullCode, AirportFullName)

      implicit none

      integer, intent(out) :: num_GlobAirports

      integer :: i

      allocate(AirportFullLat(MAXAIRPORTS))
      allocate(AirportFullLon(MAXAIRPORTS))
      allocate(AirportFullCode(MAXAIRPORTS))
      allocate(AirportFullName(MAXAIRPORTS))

      i = 0;
      i=i+1; AirportFullLat(i)= 41.60833_ip; AirportFullLon(i)= 271.905830_ip; 
             AirportFullCode(i)="II2"; AirportFullName(i)="Lewis University Airport, IL              "; 
